using Shouldly;
using System;
using System.Linq;
using System.Threading.Tasks;
using HRManagementSoftware.LeaveRequests;
using HRManagementSoftware.EntityFrameworkCore;
using Xunit;

namespace HRManagementSoftware.EntityFrameworkCore.Domains.LeaveRequests
{
    public class LeaveRequestRepositoryTests : HRManagementSoftwareEntityFrameworkCoreTestBase
    {
        private readonly ILeaveRequestRepository _leaveRequestRepository;

        public LeaveRequestRepositoryTests()
        {
            _leaveRequestRepository = GetRequiredService<ILeaveRequestRepository>();
        }

        [Fact]
        public async Task GetListAsync()
        {
            // Arrange
            await WithUnitOfWorkAsync(async () =>
            {
                // Act
                var result = await _leaveRequestRepository.GetListAsync(
                    leaveType: default,
                    leaveStatus: default,
                    reason: ""
                );

                // Assert
                result.Count.ShouldBe(1);
                result.FirstOrDefault().ShouldNotBe(null);
                result.First().Id.ShouldBe(Guid.Parse("7df52f80-dda1-44c8-925d-7924c9f6a042"));
            });
        }

        [Fact]
        public async Task GetCountAsync()
        {
            // Arrange
            await WithUnitOfWorkAsync(async () =>
            {
                // Act
                var result = await _leaveRequestRepository.GetCountAsync(
                    leaveType: default,
                    leaveStatus: default,
                    reason: ""
                );

                // Assert
                result.ShouldBe(1);
            });
        }
    }
}